import React, { useEffect, useState } from "react";
import axios from "axios";
import keys from "../../config/keys";
import { Card, CardTitle, CardBody } from "@progress/kendo-react-layout";
import "../pages.css";

const Project = () => {
  const [data, setData] = useState({});

  useEffect(() => {
    const url = keys.backendURI + "/api/education";
    const fetchData = async () => {
      const result = await axios(url);
      setData(result.data);
      // console.log(data.data[1]);
    };
    fetchData();
  }, []);
  if (!data.data) return null; // // empty render until we get data

  // if we get data we do have education details
  return (
    <div className="component-section">
      <div className="content-heading">PROJECT</div>
      <div className="card-content-row">
        <div className="card-content">
          <Card
            style={{
              margin: 100,
              marginLeft: 100,
              marginTop: 100,
              borderWidth: 2,
            }}
          >
            <CardBody className="card-body">
              <CardTitle>
                <h2>
                  Mission-driven full stack developer with a passion for
                  thoughtful UI design, collaboration, and teaching.
                </h2>
              </CardTitle>
              <br />
              <p className="discription">
                {/* Fetch the ABOUT through API */}
                Some quick example text to build on the card title and make up
                the bulk of the card content.
              </p>
            </CardBody>
          </Card>
        </div>
        <div className="card-content">
